import styled from "@emotion/styled";
import { CategoryT } from "../typesTS/CategoryT";
import { rgba } from "emotion-rgba";
// import styled from "@emotion/styled/macro";
const CategoryItem = styled.div`
  height: 45px;
  background-color: #fff;
  width: 100%;
  display: grid;
  grid-template-columns: 50px auto;
  grid-template-rows: 45px;
`;
const PicSection = styled.div`
  grid-column-start: 1;
  grid-column-end: 2;
`;
const TextSection = styled.div`
  grid-column-start: 2;
  grid-column-end: 3;
  font-family: "Jost", sans-serif;
  font-weight: 400;
  font-size: 12px;
`;
const inactiveColor = "#000";

const TextItem = styled.p`
  margin-left: 6px;
  margin-top: 16px;
  color: ${rgba(inactiveColor, 0.5)};
`;
const IconItem = styled.img`
  margin-left: 30px;
  margin-top: 14px;
  height: 16px;
`;
export default function Category({ category }: { category: CategoryT }) {
  // styles

  return (
    <CategoryItem>
      <PicSection>
        <IconItem src={category.picAdress}></IconItem>
      </PicSection>
      <TextSection>
        <TextItem>{category.text}</TextItem>
      </TextSection>
    </CategoryItem>
  );
}
